  TAKE_SHOT: "Take shot",
  LOADING: "Loading",
  WAITING_FOR_PROCESSING: "Wait image to be processed",
  DISPLAY_GOOD_RESULT: "Display good news",
  DISPLAY_BAD_RESULT: "Display bad news",
  NO_CAMERA_DETECTED: "No camera on device",
